import { useParams } from "react-router-dom";

function Food({foods}){
    const params = useParams();

    console.log(params);


    const food = foods ? foods.filter(food => params.id === food.id) : null;
    console.log(food)

    return (
        <div>
            { food ? <h2>{food.name}{food.emoji}</h2> : <h2>Loading...</h2>}

        </div>
    )
}

export default Food
